import { values } from './values';
describe('Test for values as data first', function () {
    it('should return values of array', function () {
        expect(values(['x', 'y', 'z'])).toEqual(['x', 'y', 'z']);
    });
    it('should return values of object', function () {
        expect(values({ a: 'x', b: 'y', c: 'z' })).toEqual(['x', 'y', 'z']);
    });
});
